// \u53C2\u6570 source \u662F less \u6587\u4EF6\u7684\u5185\u5BB9
function lessLoader(lessSource) {
  let css;
  //\u8FD9\u91CCless.render\u5176\u5B9E\u4E5F\u5C31\u662F\u628Aless\u89E3\u6790\u6210AST,\u7136\u540E\u518D\u751F\u6210css
  less.render(lessSource, { filename: this.resource }, (err, output) => {
    css = output.css;
  });
  return css;
}

module.exports = lessLoader;
